/**
 * @class Config
 * @description
 * Contains global variables for the configuration of the client component
 */
(function () {

	const themeEnum = {
		red : 'red',
		blue : 'blue',
		yellow : 'yellow',
	};

	/**
	 * Contains the global variables for the configuration
	 */
	var config = {

		// ********** variabili di configurazione del framework, impostate nella funz init del main
		backendUrl: "http://localhost:54471/",  // backend url
		basePath: "", //"../", // path relativo per arrivare alla cartella "client"
		basePathMetadata: "metadata/",
		env: appMeta.config.envEnum.DEV,
		forceShowErrorInfo: true,
		rootElement: "#metaRoot", // id dell'elemento html root dove vengono ospitate le metaPage
		rootLogin: "#login", // id dell'elemento html root dove vengono ospitate le metaPage
		enableSearchLikeOnTextBox: false,
		defaultDecimalFormat: 'n',
		defaultDecimalPrecision: 2,

		//Single Sign On
		ssoEnable: false,
		ssoPath: "/saml/DefaultSAML.aspx",
		ssoLogoutUrl: "",
		SSOSingleCheckLogout: true,
		SSODoubleCheckLogout: true,

		ldapEnabled: false,

		//pagina di registrazione che automaticamente parte in insert mode
		registrationUserTableName: "registrationuser",
		registrationUserEditType: "usr",

		//dati di accesso
		dataContabileYear: new Date().getFullYear(),
		codiceDipartimento: 'amministrazione',
		virtualUserUserKind: 3,

		path_maintoolBarTemplate: "components/userTemplate/mainToolBar_Template.html",
				// override path dei template. Devono stare sotto components/userTemplate

		//logo
		logoBase64: "data:image/png;base64,",
		timesheetLogoCellTL: 'A21',
		timesheetLogoCellBR: 'E32',

		// logo tempo dx
		tempo_brand_logo_id: "data:image/png;base64,",

		cssTheme: themeEnum.blue,
		setTheme: function (theme) {
			var r = document.querySelector(':root');
			if (theme === appMeta.themeEnum.yellow) {
				r.style.setProperty('--main-bg-color', '#FCE30B');
				r.style.setProperty('--clear-bg-color', '#FCF3CF');
				r.style.setProperty('--link-color', '#F1C40F');
				r.style.setProperty('--hover-and-nav-link-color', '#D4AC0D');
				r.style.setProperty('--modal-header-gradient-c', '#D4AC0D');
				r.style.setProperty('--nav-link-forecolor', '#191919');
				r.style.setProperty('--btn-primary-bg-color', '#F4D03F');
				r.style.setProperty('--btn-primary-hover-color', '#FCF3CF');
				return;
			}

			if (theme === appMeta.themeEnum.red) {
				r.style.setProperty('--main-bg-color', '#E74C3C');
				r.style.setProperty('--clear-bg-color', '#F5B7B1');
				r.style.setProperty('--link-color', '#E74C3C');
				r.style.setProperty('--hover-and-nav-link-color', '#CD6155');
				r.style.setProperty('--modal-header-gradient-c', '#7B241C');
				r.style.setProperty('--nav-link-forecolor', '#f0f0f0');
				r.style.setProperty('--btn-primary-bg-color', '#FA8072');
				r.style.setProperty('--btn-primary-hover-color', '#fbec88');
				return;
			}

			// default = "blue"

			r.style.setProperty('--main-bg-color', '#0d4b75');
			r.style.setProperty('--clear-bg-color', '#b8d8f8');
			r.style.setProperty('--link-color', '#0073e6');
			r.style.setProperty('--hover-and-nav-link-color', '#21649e');
			r.style.setProperty('--modal-header-gradient-c', '#1e5799');
			r.style.setProperty('--nav-link-forecolor', '#f0f0f0');
			r.style.setProperty('--btn-primary-bg-color', '#428BCA');
			r.style.setProperty('--btn-primary-hover-color', '#38e4ff');

		}
	};

	appMeta.appMainConfig = config;
	appMeta.themeEnum = themeEnum;
}());


